import style from "./Forms.module.css"

const Forms=()=>{
    return(
    <Forms className={style.Forms}>
        <h1>Welcome!!</h1>
    <label>
        <input>email</input>
    </label>
    <label>
        <input>passworrd</input>
    </label>
     <button>Submit</button>

    </Forms>
    )
 }
 export default Forms;
